import {useState , useEffect} from 'react';
import Paper from '@material-ui/core/Paper';
import {
  Scheduler,
  WeekView,
  Appointments,
} from '@devexpress/dx-react-scheduler-material-ui';

import appointments from './Components/Today-appointments';

const Index = ()=>{
    const [data,setData]=useState();
    useEffect(()=>{
      setData(appointments);
    });
    return(
      <Paper>
        <Scheduler
          data={data}
          height={660}
        >
          <WeekView
            startDayHour={9}
            endDayHour={19}
          />
          <Appointments />
        </Scheduler>
      </Paper>
    )
}
